import React, {Component} from 'react'
import queryString from 'query-string'
import axios from 'axios'
import UsersStyle from '../components/styles/UsersStyle.css'

class LoadStreamers extends React.Component{
  render(){
    const { infoName, infoImg, infoBio } = this.props
    if(infoBio==null){
      infoBio= 'Streamer de twitch.'
    }else{
      infoBio=infoBio
    }
    return (
      <div className="list list-row block">
      <div className="list-item" data-id="19">
        <div>
          <span className="w-48 avatar gd-warning"><img src={infoImg} /> </span>
          </div>
          <div className="flex"> <a href="#" className="item-author text-color">{infoName}</a>
              <div className="item-except text-muted text-sm h-1x"> {infoBio} </div>
          </div>
          <div className="no-wrap">
              <div className="item-date text-muted text-sm d-none d-md-block">13/12 18</div>
          </div>
      </div>
    </div>
    )
  }
}

export default LoadStreamers
